<script>
export default {
  data() {
    return {
      navOpen: false
    }
  },
  computed: {
    activeArticle() {
      return this.$store.state.activeArticle
    }
  },
  watch: {
    // Close navigation when route changes
    $route(to, from) {
      this.navOpen = false
    }
  }
}
</script>
